// Descriptors profile
var fs = require('browserify-fs');
var datas
fs.mkdir('/home', function() {
    fs.writeFile('hello-world.txt', 'Hello world!\n', function() {
        fs.readFile('hello-world.txt', 'utf-8', function(err, data) {
            datas = data
        });
    });
});
export const JSON_PROFILE = datas
